    event.preventDefault();
    const formData = new FormData();
    formData.append("username", name);
    formData.append("email", email);
    formData.append("password", password);
    // formData.append("category_id", marineCategoryId);
    // formData.append("status", marineStatus);

    // validation 
    if(!name && !email && !password){
        console.log("please fill the field")
        Swal.fire({
            title: 'Warning!!',
            text: "please fill the fields",
            icon: 'danger',
            customClass: {
                confirmButton: 'btn btn-primary'
            },
            buttonsStyling: false
        })
        return
    }

    try {     
        const response = await axios({
            method: "post",
            url: "http://34.254.97.212:8080/api/users/adduser",
            data: formData,
            headers: { "Content-Type": "multipart/form-data", Authorization: apiKey },
        })
        console.log(response)
        if(response.code == 200){
            Swal.fire({
                title: 'Done!!',
                text: response.data.message,
                icon: 'success',
                customClass: {
                    confirmButton: 'btn btn-primary'
                },
                buttonsStyling: false
            })
        }else{
            return Swal.fire({
                title: 'Error!!',
                text:  response.data.message,
                icon: 'Warning',
                customClass: {
                    confirmButton: 'btn btn-primary'
                },
                buttonsStyling: false
            })
        }
    } catch (error) {
        console.log(error);
        // setFlag(false);
        return Swal.fire({
            title: 'Error!!',
            text:  'Something went wrong. Server is not responding!',
            icon: 'error',
            customClass: {
                confirmButton: 'btn btn-primary'
